import s from './MyPosts.module.css'
import Post from './Post/Post'

const MyPosts = (props) => {


    let postElements = props.Posts.map(post => <Post theme={post.theme} content={post.content} likeCount={post.likeCount} />).reverse()

    return (
        <div className={s.all_posts}>
            <h2 className={s.news_title}>Мои новости</h2>

            { postElement }

        </div>
    )
}

export default MyPosts
